// Build nodes + edges
const allNodes = {};
sqlData.forEach((row) => {
  allNodes[row.view] = true;
  if (row.input) allNodes[row.input] = true;
  if (row.raw) allNodes[row.raw] = true;
});

const nodes = Object.keys(allNodes).map((id) => ({
  id,
  data: { label: id },
  style: { background: "#333", color: "#fff", borderRadius: "6px", padding: 10 },
}));

const edges = sqlData
  .filter((row) => row.input || row.raw)
  .map((row, i) => ({
    id: `e${i}`,
    source: row.input || row.raw,
    target: row.view,
    style: { stroke: "grey", strokeWidth: 2 },
    markerEnd: { type: "arrowclosed", color: "grey" },
  }));

export default function App() {
  const { nodes: layoutedNodes, edges: layoutedEdges } = getLayoutedElements(nodes, edges);

  const [rfNodes, , onNodesChange] = useNodesState(layoutedNodes);
  const [rfEdges, setEdges, onEdgesChange] = useEdgesState(layoutedEdges);

  // ðŸŸ£ Highlight path on click
  const highlightPath = useCallback((nodeId) => {
    let current = nodeId;
    const pathEdges = [];
    let found = true;

    while (found) {
      found = false;
      for (const e of edges) {
        if (e.target === current) {
          pathEdges.push(e.id);
          current = e.source;
          found = true;
        }
      }
    }

    setEdges((eds) =>
      eds.map((e) =>
        pathEdges.includes(e.id)
          ? {
              ...e,
              animated: true,
              style: { stroke: "darkviolet", strokeWidth: 3, strokeDasharray: "5 5" },
              markerEnd: { type: "arrowclosed", color: "darkviolet" },
            }
          : {
              ...e,
              animated: false,
              style: { stroke: "grey", strokeWidth: 2 },
              markerEnd: { type: "arrowclosed", color: "grey" },
            }
      )
    );
  }, []);

  const onNodeClick = useCallback((_, node) => {
    highlightPath(node.id);
  }, [highlightPath]);

  return (
    <div style={{ height: "100vh" }}>
      <ReactFlow
        nodes={rfNodes}
        edges={rfEdges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onNodeClick={onNodeClick}
        fitView
      >
        <MiniMap />
        <Controls />
        <Background color="#555" gap={20} />
      </ReactFlow>
    </div>
  );
}
